import React from "react";
import "./TodoList.css";

const TodoList = (props) => {
  return (
    <>
      <div className="todoContainer">
        <h1>All tasks</h1>
        <form>
          <input
            type="text"
            placeholder="Add a new task..."
            className="todoAdd"
            onChange={props.handleTodoList}
          />
        </form>
      </div>
    </>
  );
};
export default TodoList;
